import logo from './logo.svg';
import './App.css';
import ItemContainer from './components/ItemContainer';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <div>
        <ItemContainer items={items}/>
        </div>
      </header>
    </div>
  );
}

export default App;
